def final_positions_after_moves(n, q, commands):
    pos = [i for i in range(n)]
    cnt = 1
    temp = [0, 0]
    flag = 0
    for command in commands:
        if command[0] == 1:
            x = (n + command[1]) % n
            cnt = cnt + x
            flag = flag ^ x % 2
        else:
            if flag != 0:
                temp[0] = temp[0] - 1
                temp[1] = temp[1] + 1
            else:
                temp[0] = temp[0] + 1
                temp[1] = temp[1] - 1
            flag = flag ^ 1
    final_positions = [0] * n
    for i in range(n):
        final_positions[(pos[i] + cnt + temp[i % 2]) % n] = i + 1
    return final_positions

